import React , {useState} from 'react'
import Modal from './Modal';
import './Modal.css'
export default function TeamAdmin() {
    const [show, setShow] = useState(false);
  return (
    <div id="popup-background" className='w-full h-full'>
      <div className='w-full h-[10%] bg-white sticky top-0'>
      <button type='button' className='bg-black border-2 flex text-cyan-200 rounded-lg' onClick={()=>{setShow(true)}}>Open Modal</button>
      </div>
        <div className={`fixed z-100 w-full h-full flex flex-col items-center justify-center bg-black blur-xl`}>
        <div className='w-10 h-7 bg-slate-500'></div>

        <Modal className={show?"filter backdrop-blur-xl":""}  onClose={()=>{setShow(false)}}/>
        </div>
        
    </div>
  )
}
